import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import * as Font from 'expo-font';
import React, { useContext, useState } from 'react';
import SideMenu from './components/Menu';
import AddAnnouncement from './pages/AddAnnouncement';
import Announcement from './pages/Announcement';
import Announcements from './pages/Announcements';
import Donations from './pages/Donations';
import HomeScreen from './pages/Home';
import Login from './pages/Login';
import Appoitment from './pages/process/Appoitment';
import Form1 from './pages/process/Form1';
import Form2 from './pages/process/Form2';
import Form3 from './pages/process/Form3';
import Form4 from './pages/process/Form4';
import Form5 from './pages/process/Form5';
import Form6 from './pages/process/Form6';
import Register from './pages/Register';
import Start from './pages/Start';
import {
  AuthenticatedUserContext,
  AuthenticatedUserProvider,
} from './providers';
import * as SplashScreen from 'expo-splash-screen';

const Stack = createNativeStackNavigator();
export default function App() {
  const [fontsLoaded, setLoaded] = useState(false);
  const { user } = useContext(AuthenticatedUserContext);

  const customFonts = {
    Fraunces: require('./assets/fonts/FrauncesVariableFontSOFTWONKopszwght.ttf'),
    Outfit: require('./assets/fonts/OutfitVariableFontwght.ttf'),
  };

  const loadFontsAsync = async () => {
    await SplashScreen.preventAutoHideAsync();
    await Font.loadAsync(customFonts);
    await new Promise((resolve) => setTimeout(resolve, 2000));
  };

  React.useEffect(() => {
    loadFontsAsync();
    console.log(fontsLoaded);
  }, []);

  if (!fontsLoaded) {
    return (
      <AppLoading
        startAsync={loadFontsAsync}
        onFinish={() => setLoaded(true)}
        onError={() => {}}
      />
    );
  }

  return (
    <AuthenticatedUserProvider>
      <NavigationContainer>
        <Stack.Navigator initialRouteName={user ? 'Donations' : 'Appointment'}>
          <Stack.Screen name='Home' component={HomeScreen} />
          <Stack.Screen
            name='Announcements'
            component={Announcements}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              headerShown: false,
              exact: true,
            }}
          />
          <Stack.Screen
            name='AddAnnouncement'
            component={AddAnnouncement}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              // headerShown: false,
            }}
          />
          <Stack.Screen
            name='Donations'
            component={Donations}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              headerShown: false,
            }}
          />
          <Stack.Screen
            name='Appointment'
            component={Appoitment}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Announcement'
            component={Announcement}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              exact: true,
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form1'
            component={Form1}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form2'
            component={Form2}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form3'
            component={Form3}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form4'
            component={Form4}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form5'
            component={Form5}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Form6'
            component={Form6}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Start'
            component={Start}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerShown: false,
            }}
          />
          <Stack.Screen
            name='Register'
            component={Register}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Login'
            component={Login}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
            }}
          />
          <Stack.Screen
            name='Menu'
            component={SideMenu}
            options={{
              title: '',
              headerStyle: {
                backgroundColor: '#ffffff',
                border: 'none',
              },
              headerShadowVisible: false, // applied here
              headerBackVisible: false,
              headerShown: false,
            }}
          />
        </Stack.Navigator>
      </NavigationContainer>
    </AuthenticatedUserProvider>
  );
}
